package maxvowels

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

var result int

var tests = []struct {
	input    string
	k        int
	expected int
}{
	{
		"abciiidef",
		3,
		3,
	},
	{
		"aeiou",
		2,
		2,
	},
	{
		"leetcode",
		3,
		2,
	},
	{
		"weallloveyou",
		7,
		4,
	},
	{
		"",
		57373,
		11107,
	},
}

func TestMaxVowels(t *testing.T) {
	for i, test := range tests {
		t.Log("test ", i+1)

		got := maxVowels(test.input, test.k)
		assert.Equal(t, test.expected, got)

		t.Log("got: ", got, ", expected: ", test.expected)

		got2 := maxVowelsV3(test.input, test.k)
		assert.Equal(t, test.expected, got2)

		t.Log("got2: ", got2, ", expected: ", test.expected)
	}
}

func BenchmarkCompress(b *testing.B) {
	funcs := []struct {
		name string
		f    func(string, int) int
	}{
		{"mine", maxVowels},
		{"mine-v3", maxVowelsV3},
		{"leet-fastest", maxVowels_leet0ms},
	}

	var res int
	for _, fun := range funcs {

		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				res = fun.f(tests[k%len(tests)].input, tests[k%len(tests)].k)
			}

		})
	}

	result = res
}
